text:
@emiliekrajcik on sexual violence part 2. â€œthat incident changed the course of my life. i will never be the same. though i do not re-live the pain every day, it does still affect me. i have not been able to be sexually active since then because i am so afraid. i find it hard to trust and i am triggered by the news when events such as the kavanaugh trial are occurring.
despite the difficulties, i am stronger now. i have new standards, boundaries and a higher purpose in life. i do not take for granted my health and happiness and i am better for it. i believe this was a part of my spiritual journey and that i am here to help other women through their experience. i am working towards creating a membership program which will facilitate female friendships, educate women on their rights, advocate for them, and provide them with counselling. i really would like to provide both traditional and non-traditional approaches to healingâ€ #ourwomensvoices 
emilie will speaking at our next workshop on sexual violence and healing, visit the link our bio to rsvp.ğŸ’œ

