@rainn (rainn | rape, abuse & incest national network) "is the nation's largest anti-sexual violence organization. rainn created and operates the national sexual assault hotline (800.656.hope, online.rainn.org y rainn.org/es) in partnership with more than 1,000 local sexual assault service providers across the country and operates the dod safe helpline for the department of defense. rainn also carries out programs to prevent sexual violence, help survivors, and ensure that perpetrators are brought to justice." (source: www.rainn.org/about-rainn) .
